import React, { Component } from "react";

class Buttons extends Component {
    render () {
        return (
            <div className="buttons">
                <button onClick={() => this.props.userNumDecrease()}>{"< Previous"}</button>
            
            <div>
                <button>{"Edit"}</button>
                <button>{"Delete"}</button>
                <button>{"New"}</button>
           </div>
            
            
            
           <button onClick={() => this.props.userNumAdd()}>{"< Previous"}</button>
            </div>
        )
    }
}

export default Buttons;
